import React, { Component } from 'react';
import { Link } from 'react-router-dom'

class Header extends Component {
    render() {
        return (
            <header>
                <nav>
                <ul>
                    <li><Link to='/'>Create user</Link></li>
                    <li><Link to='/users'>User list</Link></li>
                </ul>
                </nav>
            </header>
        )
    }
}

export default Header
